import React from 'react'
import './style.css'
import { CommentListItem } from 'types/interface'

interface Props {
    commentListItem: CommentListItem
}

//          component: Comment List Item 컴포넌트          //
export default function CommentItem({ commentListItem }: Props) {



  //          render: Comment List Item 렌더링          //  
  return (
    <div className='comment-list-item'>
        <div className='comment-list-item-top'>
            <div className='comment-list-item-profile-box'>
                <div className='comment-list-item-profile-image' style={{ backgroundImage : `url()`}}></div>
            </div>
            <div className='comment-list-item-nickname'>{`안녕하세요나는주코야키`}</div>
            <div className='comment-list-item-divider'>{`|`}</div>
            <div className='comment-list-item-time'>{`3분전`}</div>
        </div>
        <div className='comment-list-item-main'>
            <div className='comment-list-item-content'>
                {`오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?오늘 점심을 뭐먹을 지 너무 고민이 되는데 뭐 먹을까?`}
                </div>
        </div>
    </div>
  )
}
